import React from 'react'
import {Login, Info} from '../../component/index.js'


class Welcome extends React.Component{
    render(){
        return(
            <div>
                <div className='header'>
                    <h1>Be Up</h1>
                </div>

                <div className='main'>

                    <div>
                        <Login />
                    </div>

                    <div>
                        <Info />
                    </div>
                </div>
            </div>
        )
    }
}

export default Welcome;
